function accountStart() {
  addAccountListeners();
  fillAccountFields();
}

function addAccountListeners(){
  $("[data-element='modal-success']").hide();
  $("[data-element='modal-error']").hide();
  $("[data-element='modal-confirm-delete-account']").hide();

  $('#update-info').click(function() {

    if ($($("#update-info").children()[0]).children().text() == "Saved") {
      return; 
    }

    if ($('#field-info-username').val().length == 0) {
      showError("Username can't be blank");
      $('#field-info-username').val(user.username);
      return;
    }

    if (!validateEmail($("#field-info-email").val())) {
      showError("Email is invalid");
      $("#field-info-email").val(user.email);
      return
    }

    var username = $('#field-info-username').val();
    var first_name = $('#field-info-firstname').val();
    var last_name = $('#field-info-lastname').val();
    var email = $("#field-info-email").val();
  	$.ajax({
      type: "POST",
      url: "/update_user_info",
      data: {	user: { username: username,
      		  	first_name: first_name,
      		  	last_name: last_name,
              email: email }
			      },
      dataType: "JSON",
      success: function (response) {
        if (response.success) {
            if (response.ok) {
              $("#change-email-sended").show();
            }
            showUpdateInfoSaved();
            mixpanelIdentify(response.id);    
            mixpanelPeopleSet({ 'Username': username, "$first_name": first_name, "$last_name": last_name });
          }
        else {
          $('#field-info-username').val(user.username);
          $('#field-info-firstname').val(user.first_name);
          $('#field-info-lastname').val(user.last_name);
          $("#field-info-email").val(user.email);
          showError(response.error);
        }
      },
      error: function() { $('#modal-server-unavailable').show(); }
  	});
  });

  $('#update_password-info').click(function() {

    if ($($("#update_password-info").children()[0]).children().text() == "Saved")
      return; 

    if ($("#basic-info-3")[0].style.display != "none") {
      if ($('#field-info-new_password').val() != $('#field-info-new_password_confirmation').val()) {
        $("#modal-new-and-confirm-password-dont-match").show();
        return;
      }

      if ($("#field-info-current_password").val().length < 8) {
        $('#modal-password-dont-match').show();
        return;
      }

      if ($("#field-info-new_password").val().length < 8) {
        $('#modal-short-password').show();
        return;      
      }
    } else {
      if ($('#field-info-new_password_1').val() != $('#field-info-new_password_confirmation_1').val()) {
        $("#modal-new-and-confirm-password-dont-match").show();
        return;
      }

      if ($("#field-info-new_password_1").val().length < 8) {
        $('#modal-short-password').show();
        return;      
      }
    }

    if ($('#field-info-current_password').val().length > 0)
    {
      $.ajax({
        type: "POST",
        url: "/update_password",
        data: { user: { current_password: $('#field-info-current_password').val(), 
                password: $('#field-info-new_password').val(),
                password_confirmation: $('#field-info-new_password_confirmation').val()}
              },
        dataType: "JSON",
        success: function (response) {
          if (response.success)
            showPasswordSaved();
          else
            $('#modal-password-dont-match').show();
        },
        error: function() { $('#modal-server-unavailable').show(); }
      });
    }
    else
    {
      $.ajax({
        type: "POST",
        url: "/update_password",
        data: { user : { password: $('#field-info-new_password_1').val(),
                password_confirmation: $('#field-info-new_password_confirmation_1').val()}
              },
        dataType: "JSON",
        success: function (response) {
          if (response.success)
          {
            $("#basic-info-3").show();
            $("#basic-info-4").show();
            $("#basic-info-5").hide();
            showPasswordSaved();
          }
          else
            showError("Input error");
        },
        error: function() { $('#modal-server-unavailable').show(); }
      });
    }
  });

  $('#delete-info').click(function() {
    $("#modal-delete-account").show();
  });

  $("#send-delete-email-button").click(function() {
    $.ajax({
      type: "POST",
      url: "/send_destroy_email",
      dataType: "JSON",
      success: function (response) {
        $("[data-element='modal-confirm-delete-account']").hide();
        if (response.success)
          $("#modal-delete-account").hide();
        else
          showError("There was a problem sending the confirmation email. Please try again.");
      },
      error: function() { 
        $("#modal-delete-account").hide();
        $('#modal-server-unavailable').show(); 
      }
    });
  });

  $("#delete-disagree-button").click(function() {
    $("[data-element='modal-confirm-delete-account']").hide();
  });
}

function showSuccess(header, text) {

  var success_header = header || "Success!";
  var success_text = text || "Сompleted successfully";
  
  $("#success-header").text(success_header);
  $("#success-text").text(success_text);

  $("[data-element='modal-success']").show();
}

function showError(text) {
  if (text == undefined)
    $("#error-text").text("Сompleted successfully");
  else
    $("#error-text").text(text);
  $("[data-element='modal-error']").show();
}

var user;

function fillAccountFields() {
  $.ajax({
  type: "GET",
  url: "/get_user_info",
  dataType: "JSON",
  success: function (response) {
    if (response.success) {
      user = response.user;
      $("#field-info-username").val(response.user.username);
      $("#field-info-email").val(response.user.email);
      $("#field-info-firstname").val(response.user.first_name);
      $("#field-info-lastname").val(response.user.last_name);
      if (response.text == null || response.text == undefined || response.text == "") {
        response.text = 'Hi, I am the Noisli distraction-free text editor :)' + '\n' + '\n' +
                        'Here you can write plain text or you can use the Markdown syntax.' + '\n' + 
                        'The text will automatically be saved on your profile, but since I am still in Beta version, please consider saving your text regularly by using the save function on the right.' + '\n' + '\n' +
                        'Have a relaxing, distraction free time with your writing :)';
      }
      $("#editor_code").val(response.text);
      $("#editor_code").autosize();
      $("#editor_code").trigger('autosize.resize');
      var source = document.getElementById('editor_code');
      var output = document.getElementById('preview_code');
      var html = marked(source.value);
      output.innerHTML = '<div class="markdown-body">'+html+'</div>';
      $("#preview_code").innerHTML = '<div cwlass="markdown-body">'+html+'</div>';
      if (response.password_present == true) {
        $("#basic-info-3").show();
        $("#basic-info-4").show();
        $("#basic-info-5").hide();
      } else {
        $("#basic-info-3").hide();
        $("#basic-info-4").hide();
        $("#basic-info-5").show();
      }
      mixpanelIdentify(user.id.toString());
      mixpanelRegister("$email");
      mixpanelPeopleSet({ "Sign Up Date": response.confirmed_at, "$email": user.email, "Last Session": Date(), "Used on Web": "Yes" });
      mixpanelIncrement("Session");
    }
    else
      showError();
  },
  error: function() { $('#modal-server-unavailable').show(); }
  });
}

function validateEmail(email) { 
    var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(email);
}


