function trackSignupEvent(event, label) {
	if(label){
		//TODO: A/B testing only remove this in the future, to avoid bad Analytics code
		if(label == "Email" || label == "Facebook" || label == "Google") {
			_gaq.push(['_trackEvent', 'AB 003 Signup', label]);
			console.log("EVENT REGISTERED: " + "[ AB 003 Signup, " + label + " ]");
		} else {
			_gaq.push(['_trackEvent', 'Sign up', event, label]);
			console.log("EVENT REGISTERED: " + "[ Sign up, " + event + " , " + label + " ]");
		}
	} else {
		_gaq.push(['_trackEvent', 'Sign up', event]);
		console.log("EVENT REGISTERED: " + "[ Sign up, " + event + " ]");
	}
}

