function trackSignupFacebook(target) {
	//console.log("Let's track it Facebook! Target: " + target);
	if(lastSignupEvent == signupCodes.homepage_login) {
		//dont track signups coming from login
		return;
	} else if(lastSignupEvent == "" && target == "signup-fb") {
		//if lastSignupEvent is empty, then this is a direct signup from URL
		lastSignupEvent = signupCodes.direct_modal + " / Modal";
		trackSignupEvent(lastSignupEvent, "Facebook");
	} else if(lastSignupEvent != "" && target == "signup-fb") {
		lastSignupEvent = lastSignupEvent + " / Modal";
		trackSignupEvent(lastSignupEvent, "Facebook");
	} else if(target == "signup-fb-features") {
		lastSignupEvent = signupCodes.features_signup_form + " / Form";
		trackSignupEvent(lastSignupEvent, "Facebook");
	}
}

function trackSignupGoogle(target) {
	//console.log("Let's track it Google! Target: " + target);
	if(lastSignupEvent == signupCodes.homepage_login) {
		//dont track signups coming from login
		return;
	} if(lastSignupEvent == "" && target == "signup-g") {
		//if lastSignupEvent is empty, then this is a direct signup from URL
		lastSignupEvent = signupCodes.direct_modal + " / Modal";
		trackSignupEvent(lastSignupEvent, "Google");
	} else if(lastSignupEvent != "" && target == "signup-g") {
		lastSignupEvent = lastSignupEvent + " / Modal";
		trackSignupEvent(lastSignupEvent, "Google");
	} else if(target == "signup-g-features") {
		lastSignupEvent = signupCodes.features_signup_form + " / Form";
		trackSignupEvent(lastSignupEvent, "Google");
	}

}

