/* SAVE COMBO */

function saveCombo(event) {
  var comboName = $(event.target).val();

  //Empty name, go back to save and share state
  if (comboName.length < 1) {
    console.log("No name, returning to the previous state...");
    statePlayingUnknown();
    return;
  }

  //Disable temporarily the input until server's response
  $(event.target).attr("disabled", true);

  var index = getPositionInCombos();
  var comboArray = sound_controller.currentCombo();
  
  $.ajax({
    type: "POST",
    url: "/save_combo",
    data: { combo: comboArray, name: comboName, index: index },
    dataType: "JSON",
    success: function (response) {

        //Enable input again
        $(event.target).removeAttr("disabled");

        if (response.success) {
          
          //Save new combo client side
          combosArray[index] = response.combo;
          soundsArray[index] = response.sounds;

          currentCombo = $($('#combo-dashboard-ul').children()[index]).children()[0];
          $($(currentCombo).children()[0]).attr("value", combosArray[index].id);
          $($(currentCombo).children()[3]).text(combosArray[index].name);
          $($(currentCombo).children()[5]).hide();
          $(currentCombo).show();
          $($(currentCombo).parent().children()[1]).hide();
          
          //If user is not on the favorite page, show success message 
          if ($("[data-element='noisli-favorites-module']")[0].style.display == "none")
            showSavedHomePageButton();

          //Change to playing combo
          setLastAsPlaying(currentCombo, index);
          $(event.target).hide();
          statePlayingCombo(comboName);

          //reset presets
          $(".presets-span").removeClass("clicked");

          addDraggableClass();
          hideAddComboInput();
          
          $("#mobile-show-favorites").removeClass("no-combination");
                    
          if (combosArray.length > 4) {
            $("#menu-dashboard-span-save").toggleClass("no-combination");
            $("#menu-sticky-header-span-save").toggleClass("no-combination");
          }
          mixpanelIncrement("Saved Combos");
        
        } else
          showError("You can not have more than 5 combo");
    },
    error: function() {
      //Enable input again
      $(event.target).removeAttr("disabled");
      //Show error modal
      $('#modal-server-unavailable').show();
      //Show Save and Share buttonsArray
      statePlayingUnknown();
    }
  });
}

function soundPersisted(index, name) {
  for (var i = 0; i < soundsArray[index].length; i++) {
    if (soundsArray[index][i].name == name)
      return i
  }
  return -1;
}

$.ajaxSetup({
  headers: {
    'X-CSRF-Token': $('meta[name="csrf-token"]').attr('content')
  }
});

function isSoundPlay() {
  for (var i = 0; i < sound_controller.sounds.length; i++)
    if (sound_controller.sounds[i].status == "playing")
      return true;
  return false;
}

function hideAddComboInput() {
    var buttonsArray = $(".add-combo-dashboard-button");

    for (var i = 0; i <  buttonsArray.length; i++) {
      currentInput = $(buttonsArray[i]).parent().children()[0];
      if ($(currentInput)[0].style.display != "none" && $($(currentInput).parent().parent().children()[0])[0].style.display == "none") {
        $(currentInput).hide();
        $(buttonsArray[i]).show();
      }
    }
}


