var hideSavedHomePageButtonID;

//Show 'saved' message
function showSavedHomePageButton() {
  clearTimeout(hideSavedHomePageButtonID);
  $("#saved-home-show").fadeTo(200, 1, null);
  $("#menu-combo").css("width", "90px");
  hideSavedHomePageButtonID = setTimeout(hideSavedHomePageButton, 2000);
  $("#menu-combo-img").toggleClass("opa");
}
//Hide 'saved' message
function hideSavedHomePageButton() {
  $("#saved-home-show").fadeTo(200, 0, changeWidthHomePageButton);
}
//Resize menu
function changeWidthHomePageButton() {
  $("#menu-combo").css("width", "1.5%");
  $("#saved-home-show").hide();
  if ($("[data-element='noisli-favorites-module']")[0].style.display == "none")
    $("#menu-combo-img").removeClass("opa");
}

/* */

function setLastAsPlaying(lastElement, index) {
  $(document).ready( function () {
    $('.combo-active').attr("class", 'combo-nonactive');
    $(lastElement).attr("class", "combo-active");

    var objectsArray = $("#combo-dashboard-ul").children();
    var mobileObjectsArray = $(".mobile-favorites-span");
    $(mobileObjectsArray).removeClass("button-clicked");
    $($(mobileObjectsArray)[index]).toggleClass("button-clicked");
    for (var i = 0; i < objectsArray.length; i++) {
      if ($($(objectsArray[i]).children()[0])[0].style.display != "none") {
        $($(mobileObjectsArray)[i]).text($($(".combo-span")[i]).text());
        $($(mobileObjectsArray)[i]).attr("style", "display:inline-block;");
      } else {
        $($(mobileObjectsArray)[i]).hide();
      }
    }

    statePlayingCombo(combosArray[index].name);
  });
}

function reorderAfterDelete(index) {
  var objectsArray = $("#combo-dashboard-ul").children();
  $(objectsArray[index]).insertAfter( $(objectsArray).last() );

  objectsArray = $("#combo-dashboard-ul").children();
  for (var i = 0; i < objectsArray.length; i++) {
    $(objectsArray[i]).attr("id", i);
  }

  mobileObjectsArray = $(".mobile-favorites-span");
  for (var i = 0; i < objectsArray.length; i++) {
    if ($($(objectsArray[i]).children()[0])[0].style.display != "none") {
      $($(mobileObjectsArray)[i]).text($($(".combo-span")[i]).text());
      $($(mobileObjectsArray)[i]).attr("style", "display:inline-block");
    } else {
      $($(mobileObjectsArray)[i]).hide();
    }
  }
}

//Add draggable class to all combos
function addDraggableClass() {
  var itemsArray = $('#combo-dashboard-ul').children();
  //add draggable to each loaded combo
  for (var i = 0; i < combosArray.length; i++)
    $(itemsArray[i]).addClass("draggable");
  //remove draggable from each empty combo
  for (; i < itemsArray.length; i++)
      $(itemsArray[i]).removeClass("draggable");
}

function getPositionInCombos() {
  var objectsArray = $("#combo-dashboard-ul").children();
  for (var i = 0; i < objectsArray.length; i++)
    if ($($(objectsArray[i]).children()[0])[0].style.display == "none")
      break;
  return i;
}
