function keycodes() {
  keys = [0, 0, 0];
  $(document).keyup(function(event) {
    keys[0] = keys[1];
    keys[1] = keys[2];
    keys[2] = event.keyCode;
    if (keys[0] == 83 && keys[1] == 72 && keys[2] == 67) {
      cache = $("[data-element='headline']")[0].innerHTML;
      $("[data-element='headline']")[0].innerHTML = "Hello"
      $("[data-element='headline']").css("color", "black");
      $("[data-element='headline']").css("font-family", "Arial");
      setTimeout(function() {
        $("[data-element='headline']").css("color", "white");
        $("[data-element='headline']").css("font-family", "Raleway");
        $("[data-element='headline']")[0].innerHTML = cache;
      }, 2500)
    } else if (keys[0] == 66 && keys[1] == 65 && keys[2] == 65) {
      cache = $("[data-element='headline']")[0].innerHTML;
      $("[data-element='headline']")[0].innerHTML = "Hello"
      $("[data-element='headline']").css("color", "black");
      $("[data-element='headline']").css("font-family", "Arial");
      setTimeout(function() {
        $("[data-element='headline']").css("color", "white");
        $("[data-element='headline']").css("font-family", "Raleway");
        $("[data-element='headline']")[0].innerHTML = cache;
      }, 2500)
    }
  })
}

