/* POPUP MANAGEMENT */
function changeStateDevise(state) {
	var page = window.location.pathname;

	if(page == '/features' && state == 'home')
		window.location.href = '/';

	closeAllPopups();

	if(page != '/features' && state != 'home')
		goToPageState(state);
	if(page != '/features' && state == 'home')
		goToPageState('');
}


function openPopupWithTracking(popup) {
	closeAllPopups();
	goToPageState(popup);
}

function openPopupWithoutTracking(popup) {
	closeAllPopups();
	openPopup(popup);
}

function closePopupWithTracking(popup) {
	closeAllPopups();
	goToPageState('');
}

function closePopupWithoutTracking(popup) {
	closeAllPopups();
}

function goToPageState(state) {
	var title = document.title;
	History.pushState({name:state}, title, '/' + state);
}

function openPopup(name) {
	$("[data-element='modal-" + name + "']").show();
}

function closeAllPopups() {
	$("[data-element^=modal-]").hide();
}

function isAnyPopupBeingDisplayed() {
	return $("[data-element^=modal-]").children(':visible').length != 0 ||
		($("#modal-welcome-steps").data('bs.modal') || {}).isShown ||
    $("body").hasClass("shepherd-active");
}

//Manage state
function manageStates() {
  var state = History.getState();

  if( state.data.name == "login" || state.data.name == "signup" || state.data.name == "forgot" )
  	openPopup(state.data.name);

  //History.log('statechange:', state.data, state.title, state.url);
}

// Bind to StateChange Event
History.Adapter.bind(window,'statechange',function(){
    manageStates();
});
