function random(maxValue) {
	random_number = Math.floor(Math.random() * maxValue);
	return random_number;
}

function loadPreset(presetSoundsArray) {
	soundManager.stopAll();
	for (var i = 0; i < sound_controller.sounds.length; i++) {
		index = isPersisted(presetSoundsArray, sound_controller.sounds[i].name);
    	if (index != -1) {
	        soundManager.play(sound_controller.sounds[i].name);
	        sound_controller.sounds[i].status = "playing"; 
	        sound_controller.view.playSoundImage(sound_controller.sounds[i].name);
	       	sound_controller.adjustVolume(sound_controller.sounds[i].name, presetSoundsArray[index].volume);
	        $($('[data-element-name="' + sound_controller.sounds[i].name + '_slider"]')[0]).children()[0].style.left = (presetSoundsArray[index].volume * 100) + '%';
	        $($('[data-element-name="' + sound_controller.sounds[i].name + '_slider"]')[1]).children()[0].style.left = (presetSoundsArray[index].volume * 100) + '%';
    	} else {
	        sound_controller.sounds[i].status = "paused";
	        sound_controller.view.pauseSoundImage(sound_controller.sounds[i].name);
	        soundManager.stop(sound_controller.sounds[i].name);
          	soundManager.unload(sound_controller.sounds[i].name);
        }
    }
}

function isPersisted(presetSoundsArray, name) {
	for (var i = 0; i < presetSoundsArray.length; i++)
		if (name == presetSoundsArray[i].name)
			return i;

	return -1;
}
