$(document).ready(function() {	
    
    if ($('#combo-dashboard-ul').length){

      $('#combo-dashboard-ul').sortable({ 
      	handle: '.reorder-combo',
      	items: '.draggable',
      	update: function(event, ui) {
      		var objectsArray = $("#combo-dashboard-ul").children();
      		for (var i = 0; i < objectsArray.length; i++) {
      			index = parseInt($(objectsArray[i]).attr("id"));
      			if (combosArray[index] != undefined)
      			 combosArray[index].index = i;
      			$(objectsArray[i]).attr("id", i);
    			}

    			var tempArray = [];
    			combosArray.sort(function(a, b) { return (a.index - b.index) });
    			for (var i = 0; i < combosArray.length; i++) {
    				for (var j = 0; j < soundsArray.length; j++) {
    					if (soundsArray[j][0].combo_id == combosArray[i].id) {
    						tempArray[i] = soundsArray[j];
    					}
    				}
    			}
    			soundsArray = tempArray;
    			savePosition();
      	}
      });
    }

});

function savePosition() {
	$.ajax({
	    type: "POST",
	    url: "/reorder_combos",
	    data: { combos: combosArray },
	    dataType: "JSON",
	    success: function (response) {
	      if (!response.success)
	        showError("Sorry, combo can't be reordered, try later");
	    },
      error: function() {
        $('#combo-dashboard-ul').sortable('cancel');
        $('#modal-server-unavailable').show(); 
      }
  });
}
