function addSliderListeners() {
  $("#all-sounds-volume").slider();
  $("#all-sounds-volume").children()[1].style.left = '100%';
  $("#all-sounds-volume").slider().on('slide', function (event) {
    changeAllVolume(event.target);
  });

  $("#all-sounds-volume").css("cursor", "default");
  $($("#all-sounds-volume").children()[1]).css("cursor", "default");

  $("#sound-button").mouseenter(function () {
    slider = $("#all-sounds-volume");
    if (slider[0].style.display == "none" || slider.css("opacity") == "0")
      slider.fadeTo(200, 0.5, null);
    clearTimeout(sliderTimeoutID);
  });

  $("#sound-button").mouseleave(function () {
    slider = $("#all-sounds-volume");
    sliderTimeoutID = setTimeout(hideMainSlider, 2000);
  });

  $("#unmute-button").mouseenter(function () {
    slider = $("#all-sounds-volume");
    if (slider[0].style.display == "none" || slider.css("opacity") == "0")
      slider.fadeTo(200, 0.5, null);
    clearTimeout(sliderTimeoutID);
  });

  $("#unmute-button").mouseleave(function () {
    slider = $("#all-sounds-volume");
    sliderTimeoutID = setTimeout(hideMainSlider, 2000);
  });

  $("#all-sounds-volume").mouseleave(function () {
    slider = $("#all-sounds-volume");
    if (slider.css("opacity") == 0) {
      return
    } else {
      $("#all-sounds-volume").css("cursor", "default");
      $($("#all-sounds-volume").children()[1]).css("cursor", "default");
    }
    sliderTimeoutID = setTimeout(hideMainSlider, 2000);
  });

  $("#all-sounds-volume").mouseenter(function () {
    slider = $("#all-sounds-volume");
    if (slider.css("opacity") == 0) {
      return
    } else {
      $("#all-sounds-volume").css("cursor", "pointer");
      $($("#all-sounds-volume").children()[1]).css("cursor", "pointer");
    }
    slider.fadeTo(200, 1, null);
    clearTimeout(sliderTimeoutID);
  });

  function hideMainSlider() {
    $("#all-sounds-volume").fadeTo(200, 0, null);
  }

  $("#sound-button").click(function () {
    muteSound();
  });

  $("#unmute-button").click(function () {
    unmuteSound();
  });
}

