var sliderMuteTimeoutID;

function changeAllVolume(target) {
  clearFadeOutInterval();
  clearInterval(fadeOutStepID);
  clearTimeout(sliderMuteTimeoutID);
  sliderMuteTimeoutID = setTimeout(function () {
    checkVolume(target);
  }, 10);
}
var beforeMuteVolume;

function checkVolume(target) {
  var currentVolume;
  if (target.id == "all-sounds-volume") {
    currentVolume = $("#all-sounds-volume").children()[1].style.left;
    $("#all-sounds-volume-sticky").children()[1].style.left = currentVolume;
  } else {
    currentVolume = $("#all-sounds-volume-sticky").children()[1].style.left;
    $("#all-sounds-volume").children()[1].style.left = currentVolume;
  }

  currentVolume = parseInt(currentVolume.replace("%", "")) / 100;
  volumeBeforeFadeOut = currentVolume;
  var audio_player, name;
  for (var i = 0; i < sound_controller.sounds.length; i++) {
    if (soundManager.getSoundById(sound_controller.sounds[i].name).playState == 1)
      soundManager.getSoundById(sound_controller.sounds[i].name).setVolume(sound_controller.sounds[i].volume * currentVolume * 100);
  }

  if (currentVolume == 0) {
    muted = true;
    $("#sound-button").hide();
    $("#unmute-button").show();
    $("#sound-button-out").hide();
    $("#unmute-button-out").show();
    $("#sound-button-sticky").hide();
    $("#unmute-button-sticky").show();
    document.getElementById("all-sounds-volume").style.marginRight = "-4px";
    document.getElementById("all-sounds-volume-sticky").style.marginRight = "-4px";
  } else {
    muted = false
    beforeMuteVolume = currentVolume;
    $("#sound-button").show();
    $("#unmute-button").hide();
    $("#sound-button-out").show();
    $("#unmute-button-out").hide();
    $("#sound-button-sticky").show();
    $("#unmute-button-sticky").hide();
    document.getElementById("all-sounds-volume").style.marginRight = "0px";
    document.getElementById("all-sounds-volume-sticky").style.marginRight = "0px";
  }
}

var muted = false;

function muteSound() {
  muted = true;
  clearFadeOutInterval();
  $("#all-sounds-volume").children()[1].style.left = "0%";
  $("#all-sounds-volume-sticky").children()[1].style.left = "0%";

  $("#sound-button").hide();
  $("#unmute-button").show();
  $("#sound-button-out").hide();
  $("#unmute-button-out").show();
  $("#sound-button-sticky").hide();
  $("#unmute-button-sticky").show();

  var audio_player, name;
  for (var i = 0; i < sound_controller.sounds.length; i++) {
    var name = sound_controller.sounds[i].name;
    audio_player = soundManager.getSoundById(name);
    audio_player.setVolume(0);
  }
  document.getElementById("all-sounds-volume").style.marginRight = "-4px";
  document.getElementById("all-sounds-volume-sticky").style.marginRight = "-4px";
  volumeBeforeFadeOut = 0;
}

function unmuteSound() {
  muted = false;
  clearFadeOutInterval();
  if (beforeMuteVolume == undefined)
    beforeMuteVolume = 1;
  $("#all-sounds-volume").children()[1].style.left = beforeMuteVolume * 100 + '%';
  $("#all-sounds-volume-sticky").children()[1].style.left = beforeMuteVolume * 100 + '%';

  $("#sound-button").show();
  $("#unmute-button").hide();
  $("#sound-button-out").show();
  $("#unmute-button-out").hide();
  $("#sound-button-sticky").show();
  $("#unmute-button-sticky").hide();

  var audio_player, name;
  for (var i = 0; i < sound_controller.sounds.length; i++) {
    var name = sound_controller.sounds[i].name;
    audio_player = soundManager.getSoundById(name);
    audio_player.setVolume(sound_controller.sounds[i].volume * 100 * beforeMuteVolume);
  }
  document.getElementById("all-sounds-volume").style.marginRight = "0px";
  document.getElementById("all-sounds-volume-sticky").style.marginRight = "0px";
  volumeBeforeFadeOut = beforeMuteVolume;
}

var volumeFadeOut;

function fadeOutStep() {
  volumeFadeOut -= fadeOutStepValue;
  if (volumeFadeOut < 0)
    volumeFadeOut = 0;

  //alert(volume.toString() + " " + fadeOutStepValue);
  $("#all-sounds-volume").children()[1].style.left = (volumeFadeOut * 100) + "%";
  $("#all-sounds-volume-sticky").children()[1].style.left = (volumeFadeOut * 100) + "%";

  var audio_player, name;
  for (var i = 0; i < sound_controller.sounds.length; i++) {
    var name = sound_controller.sounds[i].name;
    audio_player = soundManager.getSoundById(name);
    if (audio_player.playState == 1)
      audio_player.setVolume(sound_controller.sounds[i].volume * volumeFadeOut * 100);
  }

  if (volumeFadeOut == 0) {
    timer.stopSound();
    clearInterval(fadeOutStepID);
  }
}
