      if (soundLinks["ogg"]) {
        ogg_url = soundLinks["ogg"][name];
      }

      if (soundLinks["mp3"]) {
        mp3_url = soundLinks["mp3"][name];
      }

      if (soundLinks["hls"]) {
        hls_url = soundLinks["hls"][name];
      }

      this.sounds.push(new Sound(name, ogg_url, mp3_url, hls_url, this.initial_volume));
      if (useHls()) {
        this.view.writeSoundPlayer(name, hls_url);
      } else if (soundManager.canPlayMIME("audio/mp3") == true)
        this.view.writeSoundPlayer(name, mp3_url);
