  adjustVolume: function (name, volume) {
    clearFadeOutInterval();
    named = name;
    volumed = volume;
    var audio_player = soundManager.getSoundById(name);
    var allVolume = 1;
    if ($("#all-sounds-volume").children()[1] != undefined) {
      allVolume = $("#all-sounds-volume").children()[1].style.left;
      allVolume = parseInt(allVolume.replace("%", "")) / 100;
    }

    for (var i = 0; i < this.sounds.length; i++) {
      if (this.sounds[i].name == name) {
        this.sounds[i].volume = volume;
      }
    }

    volume *= allVolume * 100;
    audio_player.setVolume(volume);
  },
  playOrPause: function (name) {
    for (var i = 0; i < this.sounds.length; i++) {
      if (name == this.sounds[i].name) {
        if (this.sounds[i].status == "paused") {
          if (isPlayerActive() == false)
            soundIsNotPlaying = true;
          else
            soundIsNotPlaying = false;
          soundManager.play(this.sounds[i].name);
          this.sounds[i].status = "playing";
          this.view.playSoundImage(name);
          if (signedIn == "true") {
            mixpanelIncrement("Sounds");
          }
        } else {
          soundManager.stop(this.sounds[i].name);
          soundManager.unload(this.sounds[i].name);
          this.sounds[i].status = "paused";
          if (isPlayerActive() == false)
            soundIsNotPlaying = true;
          else
            soundIsNotPlaying = false;
          this.view.pauseSoundImage(name);
        }
      }
    }
  },
  toggleProductivity: function () {

  },
