function loadTimer() {
    $.ajax({
        type: 'GET',
        url: '/get_timer',
        success: function(data, status, xhr) {
            console.log("Timer: loaded successfully");
            var loadedtimer = (data.timer)? data.timer : 25 * 60 * 1000;
            
            var time_in_seconds = loadedtimer/1000;

            var hours = Math.floor(time_in_seconds/3600);
            var minutes = Math.floor((time_in_seconds - hours * 3600)/60);
            var seconds = Math.floor(time_in_seconds - hours * 3600 - minutes * 60);

            $("#field-timer-hours").val(hours);
            $("#field-timer-minutes").val(minutes);
            $("#field-timer-seconds").val(seconds);

            if ($("#field-timer-hours").val().length == 1)
                $("#field-timer-hours").val("0" + $("#field-timer-hours").val());

            if ($("#field-timer-minutes").val().length == 1)
                $("#field-timer-minutes").val("0" + $("#field-timer-minutes").val());

            if ($("#field-timer-seconds").val().length == 1)
                $("#field-timer-seconds").val("0" + $("#field-timer-seconds").val());
            
        },
        error: function(xhr, type, exception) {
            console.log("Timer: could not be loaded");
        }
    });
}

function saveTimer() {

    var hours = parseInt($("#field-timer-hours").val()) * 3600;
    var minutes = parseInt($("#field-timer-minutes").val()) * 60;
    var seconds = parseInt($("#field-timer-seconds").val());
    var totalTime = (hours + minutes + seconds) * 1000;

    $.ajax({
        type: 'POST',
        url: '/save_timer',
        data: { timer: totalTime },
        success: function(data, status, xhr) {
            console.log("Timer: saved successfully");
        },
        error: function(xhr, type, exception) {
            console.log("Timer: could not be saved");
        }
    });
}

