var timer;
var fadeOutTime = 5000;

function Timer() {
    this.status = "stopped";
}

Timer.prototype = {
    start: function () {
        if (timer.status == "started")
            return;
        if (this.timeoutID != undefined)
            clearTimeout(this.timeoutID);

        if (fadeOutStepID != undefined)
            clearTimeout(fadeOutStepID);

        if (this.status != "paused") {
            hours = parseInt($("#field-timer-hours").val()) * 3600;
            minutes = parseInt($("#field-timer-minutes").val()) * 60;
            seconds = parseInt($("#field-timer-seconds").val());
            this.currentTimerValue = this.startTimerValue = hours + minutes + seconds;
        }

        $("#set-timer-span").css("background-color", "rgba(255, 255, 255, 0.25)");
        $("#menu-sticky-header-span-timer").css("background-color", "rgba(255, 255, 255, 0.25)");
        $("#field-timer-hours").attr("readonly", true);
        $("#field-timer-minutes").attr("readonly", true);
        $("#field-timer-seconds").attr("readonly", true);
        this.intervalID = setInterval(this.tick, 1000);
        this.status = "started";
    },

    calculateTime: function () {
        timer.seconds = Math.floor(timer.currentTimerValue % 60);
        timer.minutes = Math.floor((timer.currentTimerValue / 60) % 60);
        timer.hours = Math.floor(timer.currentTimerValue / 3600);
    },

    tick: function () {
        timer.currentTimerValue--;
        timer.calculateTime();
        timer.showTime();

        if (timer.currentTimerValue < 0)
            timer.stop();
    },

    showTime: function () {
        $("#field-timer-hours").val(timer.hours);
        $("#field-timer-minutes").val(timer.minutes);
        $("#field-timer-seconds").val(timer.seconds);

        if ($("#field-timer-hours").val().length == 1)
            $("#field-timer-hours").val("0" + $("#field-timer-hours").val());

        if ($("#field-timer-minutes").val().length == 1)
            $("#field-timer-minutes").val("0" + $("#field-timer-minutes").val());

        if ($("#field-timer-seconds").val().length == 1)
            $("#field-timer-seconds").val("0" + $("#field-timer-seconds").val());

        $("#set-timer-span").text($("#field-timer-hours").val() + ":" + $("#field-timer-minutes").val() + ":" + $("#field-timer-seconds").val());
        $("#menu-sticky-header-span-timer").text($("#set-timer-span").text());
    },


    pause: function () {
    	clearInterval(timer.intervalID);
        timer.status = "paused";
    },

    stop: function (event) {
        $("#set-timer-span").css("background-color", "rgba(255, 255, 255, 0.1)");
        $("#menu-sticky-header-span-timer").css("background-color", "rgba(255, 255, 255, 0.1)");
        clearInterval(timer.intervalID);
        if (event == undefined) {
            if (fadeOutTime != 0)
                fadeOutCalculate();
            else
                timer.stopSound();
        }
        timer.status = "stopped";
        timer.currentTimerValue = timer.startTimerValue;
        timer.calculateTime();
        timer.showTime();

        $("#start-span").text("Start");
        $("#pause-span").text("Pause");
        $("#pause-p").attr("class", "button-nonactive");
        $("#menu-sticky-header-ul-li-timer").text("Favorites");
        $("#set-timer-span").text("Set Timer");
        $('#menu-sticky-header-span-timer').text("Set Timer");

        $("#field-timer-hours").attr("readonly", false);
        $("#field-timer-minutes").attr("readonly", false);
        $("#field-timer-seconds").attr("readonly", false);
    },

    resume: function () {
        timer.pause();
        timer.currentTimerValue = timer.startTimerValue;
        timer.calculateTime();
        timer.showTime();
    },

    stopSound:function () {
        $("#all-sounds-volume").children()[1].style.left = (volumeBeforeFadeOut * 100) + "%";
        $("#all-sounds-volume-sticky").children()[1].style.left = (volumeBeforeFadeOut * 100) + "%";
        var audio_player, name;
    	for (var i = 0; i < sound_controller.sounds.length; i++) {
    		soundManager.stop(sound_controller.sounds[i].name);
            soundManager.unload(sound_controller.sounds[i].name);
            sound_controller.sounds[i].status = "paused";
            sound_controller.view.pauseSoundImage(sound_controller.sounds[i].name);
            audio_player = soundManager.getSoundById(sound_controller.sounds[i].name);
            audio_player.setVolume(sound_controller.sounds[i].volume * volumeBeforeFadeOut * 100);
    	}
    }
}

