function disallowInteractions(exceptionElement) {
  $("#logged_in").addClass("disabled-interaction");

  // exceptionElement is an optional parameter
  if (typeof exceptionElement !== "undefined") {
    $(exceptionElement).addClass("enabled-interaction");
  }
  $("#stopTour").addClass("enabled-interaction");
  
  $("body").css("overflow-y", "hidden");
}

function allowInteractions() {
  $("#logged_in").removeClass("disabled-interaction");
  
  $(".enabled-interaction").removeClass("enabled-interaction");
  $("#stopTour").removeClass("enabled-interaction");
  
  $("body").css("overflow-y", "auto");
}

function scrollToElementCenter(element) {

  var el = $( element );
  var elOffset = el.offset().top;
  var elHeight = el.height();
  var windowHeight = $(window).height();
  var offset;

  if (elHeight < windowHeight) {
    offset = elOffset - ((windowHeight / 2) - (elHeight / 2));
  }
  else {
    offset = elOffset;
  }
  var speed = 700;
  $('html, body').animate({scrollTop:offset}, speed);

}

