function createTour() {

    myTour = new Shepherd.Tour({
      defaults: {
        buttons: false,
        classes: 'shepherd-theme-arrows shepherd-theme-noisli'
      }
    });

    myTour.addStep('step-1', {
      title: 'Welcome :)',
      text: 'Here is a quick intro to the features you’ve just unlocked!',
      attachTo: '#logged_in bottom',
      advanceOn: '#start-tour click',
      when: {
        show: function() {
          trackStep("Step1");
          disallowInteractions("#start-tour");
        },
        hide: function() {
          allowInteractions();
        }
      },
      buttons: [
        {
          text: 'Start',
          action: myTour.next
        },
        {
          text: 'I know them already',
          action: skipTour,
          classes: 'skip'
        }
      ]
    });

    myTour.addStep('step-2', {
      text: 'Click on the Rain symbol<br/>to activate the sound',
      attachTo: "#logged_in [data-name='rain'] left",
      advanceOn: "#logged_in [data-name='rain'] click",
      when: {
        show: function() {
          trackStep("Step2");

          buildStopTourBtn(); // create 'leave tutorial' button

          disallowInteractions("#logged_in [data-name='rain']");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '15px 30px'
      }
    });
    

    //Since shepherd is not handling the slidechange event, we gotta do it manually
    function sliderTourEvent() {
      myTour.next();
    }

    myTour.addStep('step-3', {
      text: 'Use the slider<br/>to adjust the volume',
      attachTo: "#logged_in [data-element-name='rain_slider'] left",
      advanceOn: "#logged_in [data-element-name='rain_slider'] slidechange",
      when: {
        show: function() {
          trackStep("Step3");
          disallowInteractions("#logged_in [data-element-name='rain_slider']");
          $( "#logged_in [data-element-name='rain_slider']" ).bind( "slidechange", sliderTourEvent );
        },
        hide: function() {
          allowInteractions();
          $( "#logged_in [data-element-name='rain_slider']" ).unbind( "slidechange", sliderTourEvent );
        }
      },
      tetherOptions : {
        offset: '0 30px'
      }
    });

    myTour.addStep('step-4', {
      text: 'Click on the Forest<br/>to add it to your mix',
      attachTo: "#logged_in [data-name='forest'] right",
      advanceOn: "#logged_in [data-name='forest'] click",
      when: {
        show: function() {
          trackStep("Step4");
          disallowInteractions("#logged_in [data-name='forest']");
          scrollToElementCenter("#logged_in [data-name='forest']");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    // If the user has less than 5 combos saved (the maximum), let him save the combo
    if (savedCombosCount < 5) {
      myTour.addStep('step-5-A', {
        text: 'Click here to save your Combo,<br/>and give it a nice name :)',
        attachTo: "#menu-dashboard-span-save left",
        advanceOn: "#menu-dashboard-span-save click",
        when: {
          show: function() {
            trackStep("Step5-A");
            disallowInteractions("#menu-dashboard-span-save");
            scrollToElementCenter("#menu-dashboard-span-save");
          },
          hide: function() {
            allowInteractions();
          }
        },
        tetherOptions : {
          offset: '0 30px'
        }
      });

      myTour.addStep('step-5-A-1', {
        text: 'Click here to save your Combo,<br/>and give it a nice name :)',
        attachTo: "#save-combo-on-home-page left",
        when: {
          show: function() {
            disallowInteractions("#save-combo-on-home-page");

            $("#save-combo-on-home-page").on('blur.tour keydown.tour', function (event) {
              if (event.type == 'blur' || event.which == 13) {
                // if user focuses out of text field or presses enter, go to the next step
                myTour.next();

                // unbind 'blur' and 'enter' events to prevent multiple calls of this functions
                $("#save-combo-on-home-page").off('blur.tour keydown.tour');
              }
            });
          },
          hide: function() {
            allowInteractions();
          }
        },
        tetherOptions : {
          offset: '0 30px'
        }
      });
    }
    // If the user has more than 4 combos saved (= 5, the maximum), let him click 'next'
    else {
      myTour.addStep('step-5-B', {
        text: 'Here you can save your Combo,<br/>and give it a nice name :)',
        attachTo: "#menu-dashboard-span-save left",
        buttons: [
          {
            text: 'Next',
            action: myTour.next
          }
        ],
        when: {
          show: function() {
            trackStep("Step5-B");
            disallowInteractions("#menu-dashboard-span-save");
            scrollToElementCenter("#menu-dashboard-span-save");
          },
          hide: function() {
            allowInteractions();
          }
        },
        tetherOptions : {
          offset: '0 30px'
        }
      });
    }

    myTour.addStep('step-6', {
      text: 'Click here to see<br/>all your saved combos',
      attachTo: "#menu-combo-img right",
      advanceOn: "#menu-combo-img click",
      when: {
        show: function() {
          trackStep("Step6");
          disallowInteractions("#menu-combo-img");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    myTour.addStep('step-7', {
      text: 'From here you can play, rename,<br/>save and share your combos',
      attachTo: "#combo-dashboard-ul li.combo-list .edit-combo-button left",
      buttons: [
        {
          text: 'Ok',
          action: myTour.next
        }
      ],
      when: {
        show: function() {
          trackStep("Step7");

          // click on the 3 dots of the first combo to show the menu options
          $("#combo-dashboard-ul li.combo-list .edit-combo-button").first().click();

          disallowInteractions(".shepherd-button-secondary");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 30px',
        constraints: [
          {
            to: 'window',
            attachment: 'none'
          }
        ]
      }
    });

    myTour.addStep('step-8', {
      text: 'Click here to access<br/>the timer',
      attachTo: "#menu-timer-img right",
      advanceOn: "#menu-timer-img click",
      when: {
        show: function() {
          trackStep("Step8");
          disallowInteractions("#menu-timer-img");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    /*var sideTour = new Shepherd.Tour({
      defaults: {
        buttons: false,
        classes: 'shepherd-theme-arrows shepherd-theme-noisli'
      }
    });*/

    myTour.addStep('step-9-1', {
      text: 'Click inside and set the length<br/>of your productivity session',
      attachTo: "#modal-timer .field-timer left",
      when: {
        show: function() {
          myTour.next();
        }
      },
      tetherOptions : {
        offset: '0 30px'
      }
    });

    function spanClickEvent() {
      myTour.next();
    }

    myTour.addStep('step-9-2', {
      text: 'Once the Timer is set,<br/>click the Start button',
      attachTo: "#start-button .timer-button-start right",
      advanceOn: "#start-button .timer-button-start click",
      when: {
        show: function() {
          //sideTour.start();
          trackStep("Step9");
          $("[data-id='step-9-1']").show();
          $("#modal-timer .field-timer").addClass("enabled-interaction");
          disallowInteractions("#start-button .timer-button-start");
          $( "#start-button .timer-button-start #start-span" ).bind( "click", spanClickEvent );
        },
        hide: function() {
          //sideTour.cancel();
          $("[data-id='step-9-1']").hide();
          allowInteractions();
          $( "#start-button .timer-button-start #start-span" ).unbind( "click", spanClickEvent );
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    myTour.addStep('step-10', {
      text: 'Click here to access<br/>the Text Editor',
      attachTo: "#menu-texteditor-img right",
      advanceOn: "#menu-texteditor-img click",
      when: {
        show: function() {
          trackStep("Step10");
          disallowInteractions("#menu-texteditor-img");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    myTour.addStep('step-11', {
      text: 'Here you can save<br/>or export your text',
      attachTo: "#text-editor-save-inactive left",
      advanceOn: "#text-editor-save-inactive click",
      buttons: [
        {
          text: 'Ok',
          action: myTour.next
        }
      ],
      when: {
        show: function() {
          trackStep("Step11");
          disallowInteractions();
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 30px'
      }
    });

    myTour.addStep('step-12', {
      text: 'Click the icon again to go back<br/>to the main view',
      attachTo: "#menu-texteditor-img right",
      advanceOn: "#menu-texteditor-img click",
      when: {
        show: function() {
          trackStep("Step12");
          disallowInteractions("#menu-texteditor-img");
        },
        hide: function() {
          allowInteractions();
        }
      },
      tetherOptions : {
        offset: '0 -30px'
      }
    });

    myTour.addStep('step-13', {
      title: 'Awesome!',
      text: 'You are all set up and ready<br/>to kickstart your productivity',
      attachTo: "#logged_in bottom",
      beforeShowPromise: function() {
        $(".home-link").first().click();
      },
      buttons: [
        {
          text: 'Great :)',
          action: myTour.complete
        }
      ],
      when: {
        show: function() {
          trackStep("Step13");
          disallowInteractions(".shepherd-button-secondary");
        },
        hide: function() {
          allowInteractions();
        }
      }
    });

    myTour.on('complete', function() {
      console.log("The tour has finished");
      trackStep("Step14");
      destroyTour();
      hideStopTourButton(); // hide stop button
    });

    myTour.on('cancel', function() {
      console.log("The tour was cancelled");
      destroyTour();
      hideStopTourButton(); // hide stop button
    });

    myTour.on('start', function() {
      console.log("The tour is starting");
      trackStep("Started");
      showStopTourButton(); // show stop button

      // Stop all currently playing sounds
      sound_controller.stopAllPlayingSounds();

      // Stop (reset) timer if it's active
      if (timer) {
        timer.stop();
      }

      // Go back to homepage
      $(".home-link").first().click();
    });

}

// Initialize and start the Onboarding Tour after the user is logged in
// This function gets called by the login callback in devise.js.erb
function startTour() {

  // AJAX request to the server to get the amount of times the user logged in
  $.ajax({
    type: 'GET',
    url: '/get_account_details.json',
    dataType: 'json', // format of the response
    success: function (accountDetails) {
      // Only start the tutorial if it's the very first time the user logs in
      if (accountDetails.signin_count == 1) {

        // Only start Onboarding tour if screen is not a tablet or smartphone
        if (window.matchMedia('only screen and (min-width: 1024px)').matches) {
          // Save user's amount of saved combos (used as a condition in the tour - step 5)
          savedCombosCount = accountDetails.combo_count;

          // Create tour
          createTour();

          // Start tour
          console.log("Start onboarding tour!");
          myTour.start();
        }

      }
    }
  });

}
